import * as s from "./styled-new";

export default ({}) => {
  return (
    <>
      <s.NewPost>
        <s.ImageWrapper>
          <s.InputFile for="file">Escolher Foto</s.InputFile>
          <label style={{ padding: "10px 20px" }}>nada ainda</label>
        </s.ImageWrapper>

        <s.Input type="text" name="Autor do post" />
        <s.Input type="text" name="Local do post" />
        <s.Input type="text" name="Descrição do post" />
        <s.Input type="text" name="Hashtags" />

        <s.Button>Enviar</s.Button>
      </s.NewPost>
      <input style={{ display: "none" }} type="file" id="file" />
    </>
  );
};
